import React from "react";
import style from "./input.module.css";
const Input = ({ placeholde, onChange, type }) => {
  return (
    <>
      <input
        className={styles.input}
        type={type}
        placeholder={placeholde}
        onChange={(e) => {
          onChange(e);
        }}
      />
    </>
  );
};

export default Input;
